import React from 'react'
import { Form, Button, Input, Table, Dropdown } from 'semantic-ui-react'

function UserTable({ users, userEmailSearch, handleInputChange, handleDeleteUser, handleSearchUser, handleChangeRole }) {
    const roles = [
        { key: 'admin', value: 'ADMIN', text: 'Sim' },
        { key: 'user', value: 'USER', text: 'Não' }
    ]

    let userList
    if (users.length === 0) {
        userList = (
            <Table.Row key='no-user'>
                <Table.Cell collapsing textAlign='center' colSpan='7'>No user</Table.Cell>
            </Table.Row>
        )
    } else {
        userList = users.map(user => {
            return (
                <Table.Row key={user.id}>
                    <Table.Cell collapsing>
                        <Button
                            circular
                            color='red'
                            size='small'
                            icon='trash'
                            disabled={user.email === 'admin'}
                            onClick={() => handleDeleteUser(user.email)}
                        />
                    </Table.Cell>
                    <Table.Cell>{user.id}</Table.Cell>
                    <Table.Cell>{user.email}</Table.Cell>
                    <Table.Cell>{user.name}</Table.Cell>
                    <Table.Cell>{user.cpf}</Table.Cell>
                    <Table.Cell>{user.role}</Table.Cell>
                    <Table.Cell>
                        <Dropdown
                            placeholder='Não'
                            selection
                            options={roles}
                            onChange={(e, { value }) => handleChangeRole(user.email, value)}
                        />
                    </Table.Cell>
                </Table.Row>
            )
        })
    }

    return (
        <>
            <Form onSubmit={handleSearchUser}>
                <Input
                    action={{ icon: 'search' }}
                    name='userEmailSearch'
                    placeholder='Search by Email'
                    value={userEmailSearch}
                    onChange={handleInputChange}
                />
            </Form>
            <Table compact striped selectable>
                <Table.Header>
                    <Table.Row>
                        <Table.HeaderCell width={1}/>
                        <Table.HeaderCell width={1}>ID</Table.HeaderCell>
                        <Table.HeaderCell width={3}>Email</Table.HeaderCell>
                        <Table.HeaderCell width={4}>Name</Table.HeaderCell>
                        <Table.HeaderCell width={5}>Cpf</Table.HeaderCell>
                        <Table.HeaderCell width={2}>Role</Table.HeaderCell>
                        <Table.HeaderCell width={2}>Make Admin</Table.HeaderCell>
                    </Table.Row>
                </Table.Header>
                <Table.Body>
                    {userList}
                </Table.Body>
            </Table>
        </>
    )
}

export default UserTable
